<p>Computes the Regression Matrix of the vDataFrame.</p>
<h3 id="Parameters">Parameters<a class="anchor-link" href="#Parameters">&#182;</a></h3><table id="parameters">
    <tr> <th>Name</th> <th>Type</th> <th>Optional</th> <th>Description</th> </tr>
<tr> <td><div class="param_name">columns</div></td> <td><div class="type">list</div></td> <td><div class = "yes">&#10003;</div></td> <td>List of the vcolumns names. If empty, all the numerical vcolumns will be used.</td> </tr>
    <tr> <td><div class="param_name">method</div></td> <td><div class="type">str</div></td> <td><div class = "yes">&#10003;</div></td> <td>Method used to compute the regression matrix.<br>
                                                    <ul>
                                                        <li><b>avgx :</b> Average of the independent expression in an expression pair.</li>
                                                        <li><b>avgy :</b> Average of the dependent expression in an expression pair.</li>
                                                        <li><b>count :</b> Count of all rows in an expression pair.</li>
                                                        <li><b>cramer :</b> Cramer's V (correlation between categories).</li>
                                                        <li><b>alpha :</b> Intercept of the regression line determined by a set of expression pairs.</li>
                                                        <li><b>r2 :</b> Square of the correlation coefficient of a set of expression pairs.</li>
                                                        <li><b>beta :</b> Slope of the regression line, determined by a set of expression pairs.</li>
                                                        <li><b>sxx :</b> Sum of squares of the independent expression in an expression pair.</li>
                                                        <li><b>sxy :</b> Sum of products of the independent expression multiplied by the dependent expression in an expression pair.</li>
                                                        <li><b>syy :</b> Returns the sum of squares of the dependent expression in an expression pair.</li>
                                                        </ul></td> </tr>
    <tr> <td><div class="param_name">cmap</div></td> <td><div class="type">str</div></td> <td><div class = "yes">&#10003;</div></td> <td>Color Map.</td> </tr>
    <tr> <td><div class="param_name">show</div></td> <td><div class="type">bool</div></td> <td><div class = "yes">&#10003;</div></td> <td>If set to True, the Regression Matrix will be drawn using Matplotlib..</td> </tr>
</table>
